import React, { useState, useEffect } from 'react';
import axios from 'axios';
import '../css/EditarLocatario.css';
import logo from '../img/logo.png';
import { useNavigate, useLocation } from 'react-router-dom';

function EditarLocatario() {
  const navigate = useNavigate();
  const location = useLocation();
  const cpfEdit = new URLSearchParams(location.search).get('CPF');

  const [selectedRow, setSelectedRow] = useState(null);
  const [formData, setFormData] = useState({
    dataNascimento: '',
    cep: '',
    numero: '',
    complemento: '',
    celular: '',
    cpf: '',
  });
  const [locatarioData, setLocatarioData] = useState(null);

  useEffect(() => {
    axios.get(`http://localhost:8080/api/locatarios/search?cpf=${cpfEdit}`)
      .then((response) => {
        const locatario = response.data;
        setLocatarioData(locatario);
        setFormData((prevFormData) => ({
          ...prevFormData,
          dataNascimento: locatario.dataNascimento || '',
          cep: locatario.cep || '',
          numero: locatario.numero || '',
          complemento: locatario.complemento || '',
          celular: locatario.celular || '',
          cpf: locatario.cpf || '',
        }));
      })
      .catch((error) => {
        console.error(error);
      });
  }, [cpfEdit]);
  

  const handleChange = (e) => {
    const { id, value } = e.target;
    setFormData((prevFormData) => ({
      ...prevFormData,
      [id]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    axios.post('http://localhost:8080/api/editarlocatario', formData)
      .then((response) => {
        console.log(response.data);
      })
      .catch((error) => {
        console.error(error);
      });
  };

  if (!locatarioData) {
    return <div>Loading...</div>;
  }

  return (
    <div className="EditarLocatario">
      <header className="EditarLocatario-header">
        <table>
          <tbody>
            <tr>
              <td colSpan="2">
                <img src={logo} className="rentfyLogoEditarLocatario" alt="logo" />
              </td>
            </tr>
            <tr>
              <td>
                <fieldset className="fieldset-custom">
                  <legend>Editar Locatário</legend>
                  <form id="EditarLocatario" onSubmit={handleSubmit}>
                    <div className="form-group">
                      <label htmlFor="dataNascimento">Data de Nascimento</label>
                      <br />
                      <input
                        type="date"
                        id="dataNascimento"
                        className="rounded-input"
                        value={formData.dataNascimento}
                        onChange={handleChange}
                      />
                    </div>

                    <div className="form-group">
                      <label htmlFor="cep">CEP</label>
                      <br />
                      <input
                        type="text"
                        id="cep"
                        className="rounded-input"
                        value={formData.cep}
                        onChange={handleChange}
                      />
                    </div>

                    <div className="form-group">
                      <label htmlFor="numero">Número</label>
                      <br />
                      <input
                        type="text"
                        id="numero"
                        className="rounded-input"
                        value={formData.numero}
                        onChange={handleChange}
                      />
                    </div>

                    <div className="form-group">
                      <label htmlFor="complemento">Complemento</label>
                      <br />
                      <input
                        type="text"
                        id="complemento"
                        className="rounded-input"
                        value={formData.complemento}
                        onChange={handleChange}
                      />
                    </div>

                    <div className="form-group">
                      <label htmlFor="celular">Celular</label>
                      <br />
                      <input
                        type="tel"
                        id="celular"
                        className="rounded-input"
                        value={formData.celular}
                        onChange={handleChange}
                      />
                    </div>

                    <div className="form-group">
                      <label htmlFor="cpf">CPF</label>
                      <br />
                      <input
                        type="text"
                        id="cpf"
                        className="rounded-input"
                        value={formData.cpf}
                        onChange={handleChange}
                      />
                    </div>

                    <button type="submit" className="btnCadastrarLocatario">Editar Locatário</button>
                  </form>
                </fieldset>
              </td>
            </tr>
          </tbody>
        </table>
      </header>
    </div>
  );
}

export default EditarLocatario;
